    data: |
      SELECT DISTINCT + ( + col2 ) * cor0.col2 / ( + col0 * + cor0.col0 ) AS col1 FROM tab1 (FORMAT parquet) AS cor0;
  - name: tab1

outputs:
  - name: q11166.out
    data: |
      0
      1
      324
